import { createBrowserRouter } from "react-router-dom";//라우터 임포트
import HomePage from "./pages/Home";

createBrowserRouter([//사용하려는 경로들을 도와주는 함수?
  {path: '/', element: <p><HomePage /></p>},// / : 가장 상위디렉토리 
  //path: '/'에 element를 연결해줌
  //HomePage 컴포넌트의 내용이 열리는 것
  {}
]);

function App() {
  return <div></div>;
}

export default App;
